import"./chunk-2R6CW7ES.js";var t="Create Excel files using OpenXML SAX with styling. This is specially useful when trying to output thousands of rows.",r="The idea behind this package is to be a basic easy-to-use wrapper around a reduced subset of functions of <a href='https://www.nuget.org/packages/DocumentFormat.OpenXml'>DocumentFormat.OpenXml</a> aimed towards generating large excel files as fast as possible using the SAX method for writing.",n="At the same time, this writer should prevent you from creating an invalid file (i.e.: a file generated without any errors, but unable to be opened). Since the most common reason for a file to become corrupted when creating it using SAX is out-of-order instructions (i.e.: writing to a cell outside a sheet), this package should detect that, and throw an exception.",a={p1:"Version 2.x of this package is linked to version <a href='https://www.nuget.org/packages/DocumentFormat.OpenXml/2.20.0' rel='noopener noreferrer nofollow'>2.20 of DocumentFormat.OpenXml</a>, and starting on version 3, BigExcelCreator is linked to version <a href='https://www.nuget.org/packages/DocumentFormat.OpenXml' rel='noopener noreferrer nofollow'>3 of DocumentFormat.OpenXml</a>.",p2:"If you're already using DocumentFormat.OpenXml v2, either directly or as transitive reference, and you can't upgrade for some reason (e.g. dependency on another package), use <a href='{{lastVersion2}}' rel='noopener noreferrer nofollow'>BigExcelCreator v2</a>",p3:"Otherwise, I recommend using the latest version available."},i={p1:t,p2:r,p3:n,note:a};export{i as default,a as note,t as p1,r as p2,n as p3};
